xml.script:
'use strict';
	(function load($ = window.jQuery, w = window, d = document, c = console){
		if(!$) return Object.defineProperty(window, 'jQuery', {'set': _=>load(_)});
		if(w.location.search == '?NOSCRIPT') return d.title = '[NOSCRIPT] ' + d.title;
		//$('.photo').find('a').on('click', function(e){
		//	e.preventDefault();
		//	$('#overlay').show().addClass('image').find('img')[0].src = this.href;
		//});
		$('[data-embed]').on('click', function(e){
			e.preventDefault();
			$('#overlay').show().addClass('embed');
			$('#_embed_').contents().clone().attr('src', 'https://' + this.dataset.embed).appendTo('#overlay>.content');
			$('#overlay').find('iframe').hide().on('load', function(e){
				$(this).show();
			});
			$('#overlay').find('.content').attr('style', 'background-image: url(' + $(this).find('img')[0].src + ')');
			$('#overlay').find('.open')[0].href = this.href;
		});
		$('#overlay').on('click', function(e){
			if(e.target != this) return;
			$(this).hide().find('iframe').remove();
		});
		$('#tiktok').find('.tiktok').find('a').each(function(){
			this.title = new Date(Number(BigInt(this.title) >> 32n) * 1000).toLocaleString();
		});
		$('#instagram').find('.instagram').find('a').each(function(){
			let abc = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789-_';
			let id = [...this.title].reduce((a, b)=>a*64n+BigInt(abc.indexOf(b)), 0n);
			this.title = new Date(1314220021721 + Number(id >> 23n)).toLocaleString();
		});
	})();
